  true,\n\t\"url\": null,\n\t\"notes\": \"The Impact Evaluation of Race to the Top
  and School Improvement Grants (RTT-SIG Impact Evaluation) is a study that is part
  of the Impact Evaluation of Race to the Top and School Improvement Grants (RTT-SIG
  Impact Evaluation) program. RTT-SIG Impact Evaluation (http://ies.ed.gov/ncee/projects/evaluation/other_racetotop.asp)
  is a cross-sectional survey that assesses the implementation of the Race to the
  Top (RTT) and School Improvement Grant (SIG) programs at the State, local education
  agency (LEA), and school levels, as well as whether the receipt of RTT and/or SIG
  funding to implement a school turnaround model has had an impact on outcomes for
  the lowest-achieving schools. Additionally, the study investigates whether RTT reforms
  were related to improvements in student outcomes and whether implementation of the
  four school turnaround models, and the strategies within those models, was related
  to improvement in outcomes for the lowest-achieving schools. The study was conducted
  using a combination of telephone interviews and web-based surveys targeted to school
  administrators at the state, LEA, and school levels. Key statistics produced from
  RTT-SIG Impact Evaluation include State, LEA, and school adoption levels of policies
  and practices promoted by RTT and SIG, as well as impacts on student outcomes of
  RTT and SIG funding.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
